('23192994-5791-11ee-b7e5-c32c9051e588', '<h1 style=\"text-align:center;\"><strong>Perumahan Strategis berlokasi di Bogor dibangun dengan konsep</strong> <strong style=\"box-sizing:inherit;\">Green Urban Living</strong></h1><p style=\"text-align:center;\">Memberikan berbagai fasilitas yang menunjang dan melengkapi gaya hidup keluarga modern yang aktif</p><p>&nbsp;</p><figure class=\"image image_resized\" style=\"width:100%;\"><img class=\"mx-auto d-block\" src=\"data:image/jpeg;base64,\"></figure><p>&nbsp;</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;color:rgb(73, 73, 73);font-family:;\" work=\"\">Greenland Kemang, Bogor dirancang bagi kehidupan keluarga yang aktif dan dinamis dengan menerapkan&nbsp;<em style=\"box-sizing:inherit;margin-bottom:0px;\"><i>Green Urban Living</i></em>&nbsp;yang memadukan gaya hidup kota yang praktis dan modern dengan keindahan alam yang hijau dan menyehatkan.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;color:rgb(73, 73, 73);font-family:;\" work=\"\">Dengan memadukan sirkulasi yang praktis dan efisien, pola clustering yang lebih memberikan rasa aman serta penempatan area hijau dan fasilitas perumahan yang lebih merata dan mudah dijangkau oleh penghuni.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;color:rgb(73, 73, 73);font-family:;\" work=\"\">Greenland Kemang menyediakan berbagai fasilitas yang menarik guna menunjang aktifitas Anda sehari-hari seperti Club House, Swimming Pool, Thematic Park, Mosque, Outdoor Sport, Children Playground.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;color:rgb(73, 73, 73);font-family:;\" work=\"\">Lokasi Greenland Kemang sangat strategis berada di Jl. Raya Parung Bogor, Kemang, Kec. Kemang, Bogor, Jawa Barat 16310, dekat dengan berbagai fasilitas umum seperti sekolah, rumah sakit, jalan toll, tempat belanja, dan pasar.</p>', '<h3 class=\"heading\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;clear:both;color:rgb(51, 51, 51);font-family:;text-align:center;\" work=\"\">Denah Greenland Kemang</h3><div class=\"wpb_text_column wpb_content_element \" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;color:rgb(73, 73, 73);font-family:;\" work=\"\"><div class=\"wpb_wrapper\" style=\"box-sizing:inherit;margin-bottom:0px;\"><p style=\"box-sizing:inherit;margin-bottom:0px;margin-top:0px;text-align:center;\">Berikut ini SitePlan untuk membangun Greenland Kemang – Bogor</p><p style=\"box-sizing:inherit;margin-bottom:0px;margin-top:0px;text-align:center;\">&nbsp;</p></div></div><figure class=\"image\"><img src=\"data:image/jpeg;base64,\"></figure>', '<h3 class=\"heading\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);box-sizing:inherit;clear:both;color:rgb(51, 51, 51);font-family:;text-align:center;\" work=\"\">Video Greenland Kemang</h3><p style=\"margin-left:auto;text-align:center;\"><span style=\"background-color:rgb(255,255,255);color:rgb(73,73,73);font-family:;\"><span style=\"-webkit-text-stroke-width:0px;display:inline !important;float:none;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;orphans:2;text-align:center;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\" work=\"\">Perumahan Baru 2 Lantai di Kemang, Bogor. Harga Perdana cuma 399 jutaan! Greenland Kemang – Bogor</span></span></p><p style=\"margin-left:auto;text-align:center;\">&nbsp;</p><p style=\"text-align:center;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/UXYQqv87QgU?si=iE5MqdQ0nzPsEzzU\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autopl